import React, {useState, useEffect} from 'react';
import classes from '../../../CSS/Main.module.css'

const BigGrid = () => {
    return(
        <div>
            <ul className={classes.BigGrid}>
                <li className={classes.style1}></li>
                <li className={classes.style2}></li>
                <li className={classes.style3}></li>
                <li className={classes.style4}></li>
                <li className={classes.style5}></li>
                <li className={classes.style6}></li>
                <li className={classes.style7}></li>
                <li className={classes.style8}></li>
                <li className={classes.style9}></li>
            </ul>
        </div>
    )
}

export default BigGrid;
